import{_ as a,c as t,a as s,e as l,r as h,o as i}from"./app.109432a7.js";const f=JSON.parse('{"title":"\uB3C4\uB85D\uC8FC\uD589 \uCCAB\uC218\uC5C5 + \uBC29\uD559 \uB9C8\uC9C0\uB9C9\uB0A0","description":"","frontmatter":{"title":"\uB3C4\uB85D\uC8FC\uD589 \uCCAB\uC218\uC5C5 + \uBC29\uD559 \uB9C8\uC9C0\uB9C9\uB0A0","createBy":"2023-01-31T00:00:00.000Z"},"headers":[{"level":2,"title":"","slug":"\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}"},{"level":2,"title":"(1) \uB3C4\uB85C\uC8FC\uD589 \uC218\uC5C5","slug":"_1-\uB3C4\uB85C\uC8FC\uD589-\uC218\uC5C5"},{"level":2,"title":"(2) \uBC29\uD559 \uB9C8\uC9C0\uB9C9\uB0A0\uC5D0 \uC4F0\uB294 \uBC29\uD559 \uD6C4\uAE30","slug":"_2-\uBC29\uD559-\uB9C8\uC9C0\uB9C9\uB0A0\uC5D0-\uC4F0\uB294-\uBC29\uD559-\uD6C4\uAE30"},{"level":2,"title":"","slug":"\uC624\uB298-\uD55C\uC77C\uB4E4"},{"level":2,"title":"\uB313\uAE00","slug":"\uB313\uAE00"}],"relativePath":"sdhs/2301/230131.md"}'),n={name:"sdhs/2301/230131.md"};function d(o,e,c,p,b,_){const r=h("Comment");return i(),t("div",null,[e[0]||(e[0]=s('<h2 id="\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" tabindex="-1"><h2 style="font-size:30px;">\uC624\uB298\uC758 \uC77C\uC9C0 \u{1F3AA}</h2> <a class="header-anchor" href="#\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" aria-hidden="true">#</a></h2><p>\uBD88\uD589\uD558\uB2E4... \uACE01\uB54C\uB85C \uB3CC\uC544\uAC00\uACE0 \uC2F6\uB2E4</p><h2 id="_1-\uB3C4\uB85C\uC8FC\uD589-\uC218\uC5C5" tabindex="-1">(1) \uB3C4\uB85C\uC8FC\uD589 \uC218\uC5C5 <a class="header-anchor" href="#_1-\uB3C4\uB85C\uC8FC\uD589-\uC218\uC5C5" aria-hidden="true">#</a></h2><hr><p>\uC624\uB298\uC740 \uC7A5\uB0B4\uAE30\uB2A5 \uC2DC\uD5D8\uC5D0 \uD569\uACA9\uD55C\uC9C0 \uC57D 2\uC8FC \uAC00\uB7C9\uC774 \uC9C0\uB09C\uB0A0\uC774\uB2E4. \uB098\uB3C4 \uC774\uBC88 \uBC29\uD559\uB3D9\uC548 \uB3C4\uB85C\uC8FC\uD589 \uC218\uC5C5\uC744 \uB2E4 \uB05D\uB0B4\uACE0 \uC2F6\uC5C8\uC9C0\uB9CC \uC7A5\uB0B4\uAE30\uB2A5 \uC2DC\uD5D8\uC774 \uB05D\uB098\uACE0 \uB3C4\uB85C\uC8FC\uD589 \uC218\uC5C5\uC744 \uC7A1\uB294\uB370 \uCD5C\uB300\uD55C \uBE60\uB978 \uC77C\uC790\uAC00 \uC624\uB298 \uB9C8\uC9C0\uB9C9 \uC218\uC5C5\uBD80\uD130\uC774\uB2E4. \uBC29\uD559 \uB9C8\uC9C0\uB9C9\uB0A0\uC774\uB77C\uC11C \uC9D1\uC5D0 \uC788\uACE0 \uC2F6\uC5C8\uC9C0\uB9CC 2\uC6D4\uB2EC\uAE4C\uC9C0 \uBABB \uB530\uBA74 50\uB9CC\uC6D0\uC744 \uD1A0\uD574\uB0B4\uC57C \uD574\uC11C \uC5B4\uCA54\uC218 \uC5C6\uC774 \uC6B4\uC804\uBA74\uD5C8\uD559\uC6D0\uC73C\uB85C \uBAB8\uC744 \uC62E\uACBC\uB2E4. <br><br> \uACA8\uC6B8\uC774\uB77C\uC11C \uADF8\uB7F0\uC9C0 \uC624\uD6C4 6\uC2DC\uC9C0\uB9CC \uD574\uAC00 \uC838\uC11C \uBC16\uC740 \uAE5C\uAE5C\uD588\uB2E4. \uCC28\uB97C \uC6B4\uC804\uD55C\uC9C0 \uC880 \uC624\uB798\uB418\uC11C \uC798\uD560\uC218 \uC788\uC744\uAE4C \uC0DD\uAC01\uD588\uB294\uB370 \uBAB8\uC774 \uAE30\uC5B5\uD558\uACE0 \uC788\uC5B4\uC11C \uC5B4\uCC0C\uC800\uCC0C \uC6B4\uC804\uC744 \uD588\uB2E4. \uC880 \uB180\uB790\uB358 \uC810\uC740 \uC7A5\uB0B4\uAE30\uB2A5\uC5D0\uC11C \uC0AC\uC6A9\uD55C \uCC28\uB791 \uB3C4\uB85C\uC8FC\uD589\uC5D0\uC11C \uC0AC\uC6A9\uD558\uB294 \uCC28\uAC00 \uC644\uC804\uD788 \uB2E4\uB978\uAC83\uC774\uC5C8\uB2E4. \uBB50 \uB2F9\uC5F0\uD558\uB2E4\uACE0 \uC0DD\uAC01\uD560\uC218 \uC788\uACA0\uC9C0\uB9CC \uC6B4\uC804\uC744 \uD558\uBA74\uC11C \uC5D1\uC140\uACFC \uBE0C\uB808\uC774\uD06C, \uD578\uB4E4\uB4F1\uC758 \uAC10\uB3C4\uAC00 \uC644\uC804\uD788 \uB2EC\uB790\uB2E4. \uC7A5\uB0B4\uAE30\uB2A5\uC5D0\uC11C \uD55C\uAC83 \uCC98\uB7FC \uBE0C\uB808\uC774\uD06C\uB97C \uBC1F\uC73C\uBA74 \uAE09\uC815\uAC70\uAC00 \uB418\uB294\uB370 \uC5ED\uC2DC \uC694\uC998 \uB098\uC624\uB294 \uCC28\uB4E4\uC740 \uC61B\uB0A0\uCC28\uBCF4\uB2E4 \uD6E8\uC52C \uC88B\uAC8C \uB098\uC624\uB294\uAC83 \uAC19\uB2E4. <br><br> \uC6B4\uC804\uD558\uB294\uB370 \uAC15\uC0AC\uB2D8 \uB9D0\uB85C\uB294 \uC6B0\uB9AC\uB3D9\uB124\uAC00 \uC6B4\uC804\uD558\uAE30 \uC5B4\uB824\uC6B4 \uCABD\uC5D0 \uC18D\uD558\uB294\uAC83 \uAC19\uB2E4. \uCD1D 4\uCC28\uC120 \uB3C4\uB85C\uB4E4\uC774 \uB9CE\uC740\uB370 \uC8FC\uC704\uAC00 \uB2E4 \uC0C1\uAC00 \uC544\uB2C8\uBA74 \uC2DC\uC7A5\uC774\uB77C\uC11C \uAC70\uC758 \uC778\uB3C4\uB791 \uBD99\uC5B4\uC788\uB294 \uCC28\uC120\uC740 \uCC28\uB4E4\uC774 \uC8FC\uCC28\uB418\uC5B4 \uC788\uC5B4\uC11C \uAC70\uC758 1\uCC28\uC120 1\uAC1C\uBC16\uC5D0 \uBABB\uC4F0\uB294\uAC83\uC774\uB2E4(\uC606\uC5D0\uC11C \uC5B8\uC81C \uD280\uC5B4\uB098\uC62C\uC9C0\uB3C4 \uBAA8\uB974\uACE0). \uAC8C\uB2E4\uAC00 \uC694\uC998\uC740 \uCC28\uB4E4\uC774 \uC6B4\uC804\uBA74\uD5C8\uC7A5 \uCC28\uB77C\uACE0 \uC591\uBCF4\uB3C4 \uC548\uD574\uC900\uB2E4\uBA74\uC11C \uBB50\uB77C\uACE0 \uD558\uC168\uB294\uB370 \uC774\uB9D0\uC740 \uB0B4\uAC00 \uC6B4\uC804\uC744 \uD558\uB294\uB3D9\uC548 \uC54C\uC218 \uC788\uC5C8\uB2E4. <br><br> \uB9E8 \uCC98\uC74C\uC5D0\uB9CC \uAC15\uC0AC\uB2D8\uC774 \uC6B4\uC804\uD558\uACE0 \uC911\uAC04\uBD80\uD130\uB294 \uB0B4\uAC00 \uC6B4\uC804\uC744 \uD588\uB294\uB370 \uD0DD\uC2DC\uB4E4\uC774 \uBC29\uD5A5\uC9C0\uC2DC\uB4F1\uB3C4 \uC548\uD0A4\uACE0 \uB0B4 \uC55E\uC5D0 \uB07C\uC5B4\uB4E4\uAE30\uB97C \uB9C9 \uD558\uB294\uB370 \uC774 \uB07C\uC5B4\uB4E4\uAE30\uB9CC \uC6B4\uC804\uD558\uB294\uB3D9\uC548 4~5\uBC88\uC744 \uB2F9\uD588\uB2E4. \uC778\uD130\uB137\uC5D0\uC11C \uD0DD\uC2DC\uAE30\uC0AC\uB4E4 \uC695\uBA39\uB294\uAC8C \uC65C \uC695\uC744 \uADF8\uB807\uAC8C \uBA39\uB294\uC9C0 \uC54C\uAC83 \uAC19\uB2E4.</p><h2 id="_2-\uBC29\uD559-\uB9C8\uC9C0\uB9C9\uB0A0\uC5D0-\uC4F0\uB294-\uBC29\uD559-\uD6C4\uAE30" tabindex="-1">(2) \uBC29\uD559 \uB9C8\uC9C0\uB9C9\uB0A0\uC5D0 \uC4F0\uB294 \uBC29\uD559 \uD6C4\uAE30 <a class="header-anchor" href="#_2-\uBC29\uD559-\uB9C8\uC9C0\uB9C9\uB0A0\uC5D0-\uC4F0\uB294-\uBC29\uD559-\uD6C4\uAE30" aria-hidden="true">#</a></h2><hr><p>\uC624\uB298\uC740 \uBC29\uD559 \uB9C8\uC9C0\uB9C9\uB0A0.. \uB0B4\uC77C\uBD80\uD130 \uB2E4\uC2DC \uD68C\uC0AC\uB85C \uAC04\uB2E4. \uC878\uC5C5\uC2DD\uB0A0\uC5D0\uB294 \uBC29\uD559\uC774 \uADF8\uB798\uB3C4 \uAE38\uB2E4\uB77C\uACE0 \uC0DD\uAC01\uD588\uB294\uB370 \uC9C0\uAE08 \uC0DD\uAC01\uD574\uBCF4\uBA74 3\uC8FC \uBC29\uD559\uC740 \uB108\uBB34 \uC9E7\uC740\uAC83 \uAC19\uB2E4. \uB2E4\uC2DC \uC878\uC5C5\uC2DD\uB0A0\uB85C \uB3CC\uC544\uAC00\uACE0 \uC2F6\uB2E4. <br><br> \uBC29\uD559\uB3D9\uC548\uC740 \uADF8\uB3D9\uC548 \uC7A0\uC744 \uB9CE\uC774 \uBABB\uC790\uC11C \uADF8\uB7F0\uC9C0 \uD558\uB8E8\uC5D0 \uD3C9\uADE0 10\uC2DC\uAC04\uC529\uC740 \uC794\uAC83 \uAC19\uB2E4. \uC6D0\uB798 \uBC29\uD559\uCD08\uBC18\uC5D0\uB294 \uACF5\uBD80\uB3C4 \uD574\uBCF4\uBA74\uC11C \uC790\uAE30\uAC1C\uBC1C\uC744 \uD560\uB824\uACE0 \uD588\uB294\uB370 \uBC29\uD574\uB3C4 \uC788\uC5C8\uACE0 \uADF8\uB3D9\uC548 \uBC29\uD559\uC5D0\uB3C4 \uACC4\uC18D \uD559\uAD50\uB97C \uB2E4\uB154\uAE30 \uB54C\uBB38\uC5D0 \uB9C8\uC9C0\uB9C9 \uBC29\uD559\uC774\uB77C\uACE0 \uC0DD\uAC01\uD558\uACE0 \uADF8\uB0E5 \uB180\uC558\uB2E4. <br><br> \uB0B4\uC77C\uBD80\uD130 \uB2E4\uC2DC \uD798\uB0B4\uC11C \uB2E4\uB140\uC57C \uD558\uB294\uB370 \uACFC\uC5F0 \uB0B4\uC77C\uB3C4 \uADF8 \uB9C8\uC74C\uC774 \uBCC0\uD568\uC774 \uC5C6\uC744\uC9C0 \uBAA8\uB974\uACA0\uB2E4. \uC57C\uADFC\uB9CC \uC880 \uC548\uD558\uBA74 \uC88B\uC740\uAC83 \uAC19\uC740\uB370(\uD68C\uC0AC\uC5D0\uC11C \uC57C\uADFC\uC218\uB2F9\uC548\uC90C)....</p><h2 id="\uC624\uB298-\uD55C\uC77C\uB4E4" tabindex="-1"><h2 style="color:#ee4867;font-size:30px;">\uC624\uB298 \uD55C\uC77C\uB4E4</h2> <a class="header-anchor" href="#\uC624\uB298-\uD55C\uC77C\uB4E4" aria-hidden="true">#</a></h2><hr><ul><li>\uB3C4\uB85C\uC8FC\uD589 \uC218\uC5C5</li></ul><br><br><h2 id="\uB313\uAE00" tabindex="-1">\uB313\uAE00 <a class="header-anchor" href="#\uB313\uAE00" aria-hidden="true">#</a></h2><hr><br>',16)),l(r)])}var m=a(n,[["render",d]]);export{f as __pageData,m as default};
